package com.nanu;
 public class Stu{
	
	String name;
	String age;
	
	public Stu() {
		// TODO Auto-generated constructor stub
	}
	public Stu(String name, String age) {
		super();
		this.name = name;
		this.age = age;
	}
	public String getName() {
		return name;
	}
	public void setName(String name) {
		this.name = name;
	}
	public String getAge() {
		return age;
	}
	public void setAge(String age) {
		this.age = age;
	}
	
	
	
}